
<!DOCTYPE html>
<html lang="nl">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Sterrenreis</title>
    <style>
        body {
            margin: 0;
            overflow: hidden;
            background-color: #000;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }

        canvas {
            display: block;
            width: 100%;
            height: 100%;
        }
    </style>
<script>
function playa(){
document.getElementById('aud').play();
}
</script>
</head>
<body>
<audio style='display:none' id='aud' src='albumv.mp3'></audio>

    <canvas id="starfieldCanvas"></canvas>



<iframe style=' border: 2px solid white;  box-shadow: 0 0 20px #5768EE, 0 0 0px white;width:40vw;height:40vw;position:fixed;left:30vw;top:0vw;border-radius:20vw' src='http.html' frameborder=0 border=0></iframe>

    <script>
        // Pak het canvas en de 2D rendercontext.
        const canvas = document.getElementById('starfieldCanvas');
        const ctx = canvas.getContext('2d');

        // Variabelen voor de animatie
        const numStars = 1500; // Het aantal sterren dat wordt getekend
        const starSpeedMultiplier = 2; // Algemene snelheid van de sterren
        const starMinSize = .25; // Minimale grootte van een ster
        const starMaxSize = 10; // Maximale grootte van een ster
        let stars = []; // Array om de sterren op te slaan
        let dustClouds = []; // Array om de sterrenstofwolken op te slaan

        // Star-klasse om elke ster te beheren
        class Star {
            constructor() {
                this.reset();
            }

            // Reset de ster naar een nieuwe positie dicht bij het midden
            reset() {
                // Positie in 3D-ruimte
                this.x = (Math.random() - 0.5) * canvas.width;
                this.y = (Math.random() - 0.5) * canvas.height;
                // 'z' is de diepte, bepaalt grootte en snelheid.
                // Een kleinere z-waarde betekent dichterbij.
                this.z = Math.random() * canvas.width;
                this.z0 = this.z; // Oorspronkelijke diepte
            }

            // Update de positie van de ster voor de animatie
            update() {
                // Zorg ervoor dat de z-waarde (diepte) van de ster afneemt,
                // waardoor de ster naar voren beweegt.
                this.z -= starSpeedMultiplier * (canvas.width / 150);
                
                // Als de ster te dichtbij komt (door het scherm beweegt), reset hem
                if (this.z <= 0) {
                    this.reset();
                }
            }

            // Teken de ster op het canvas
            draw() {
                // Bereken de schermcoÃ¶rdinaten op basis van diepte (z)
                let scale = canvas.width / this.z;
                let sx = this.x * scale + canvas.width / 2;
                let sy = this.y * scale + canvas.height / 2;

                // Bereken de grootte van de ster
                let size = (1 - this.z / this.z0) * starMaxSize + starMinSize;
                size = Math.max(starMinSize, size); // Zorg dat de grootte niet te klein wordt
                
                // Stel de stijl in
                ctx.beginPath();
                ctx.fillStyle = "#fff";
                ctx.arc(sx, sy, size / 2, 0, Math.PI * 2);
                ctx.fill();
            }
        }

        // Klasse voor de bewegende sterrenstofwolk
        class DustCloud {
            // De constructor accepteert nu een optioneel argument om de wolk stil te zetten
            constructor(isStationary = false) {
                this.x = 0;
                this.y = 0;
                // De snelheid is 0 als de wolk stationair is, anders krijgt hij een waarde
                this.speedX = isStationary ? 0 : (Math.random() - 0.5) * 0.5; 
                this.speedY = isStationary ? 0 : (Math.random() - 0.5) * 0.5;
                this.blobs = []; // Array om de gekleurde 'vlekken' op te slaan
                // Maak een paar vlekken met willekeurige kleuren en posities
                for (let i = 0; i < 5; i++) {
                    this.blobs.push({
                        x: Math.random(),
                        y: Math.random(),
                        radius: Math.random() * 200 + 150,
                        color: `rgba(${Math.floor(Math.random() * 255)}, ${Math.floor(Math.random() * 255)}, ${Math.floor(Math.random() * 255)}, 0.188)`
                    });
                }
            }
            
            // Update de positie van de wolk
            update() {
                this.x += this.speedX;
                this.y += this.speedY;

                // Reset de positie om binnen de canvasgrenzen te blijven
                if (this.x > canvas.width) this.x = -this.blobs[0].radius;
                if (this.y > canvas.height) this.y = -this.blobs[0].radius;
                if (this.x < -this.blobs[0].radius) this.x = canvas.width;
                if (this.y < -this.blobs[0].radius) this.y = canvas.height;
            }

            // Teken de wolk
            draw() {
                this.blobs.forEach(blob => {
                    ctx.beginPath();
                    // Maak een radiaal verloop om de wolk zacht te laten lijken
                    const gradient = ctx.createRadialGradient(
                        blob.x * canvas.width + this.x, blob.y * canvas.height + this.y, 0,
                        blob.x * canvas.width + this.x, blob.y * canvas.height + this.y, blob.radius
                    );
                    gradient.addColorStop(0, blob.color);
                    gradient.addColorStop(1, 'rgba(0,0,0,0)');
                    ctx.fillStyle = gradient;
                    ctx.arc(blob.x * canvas.width + this.x, blob.y * canvas.height + this.y, blob.radius, 0, Math.PI * 2);
                    ctx.fill();
                });
            }
        }

        // Functie om de animatie te initialiseren
        function init() {
            // Zorg ervoor dat het canvas de volledige breedte en hoogte van het scherm heeft
            canvas.width = window.innerWidth;
            canvas.height = window.innerHeight;

            // Maak de sterren aan
            stars = [];
            for (let i = 0; i < numStars; i++) {
                stars.push(new Star());
            }

            // Maak meerdere sterrenstofwolken aan, sommige stilstaand en anderen bewegend
            dustClouds = [];
            dustClouds.push(new DustCloud()); // Een bewegende wolk
            dustClouds.push(new DustCloud(true)); // Een stilstaande wolk
            dustClouds.push(new DustCloud(true)); // Nog een stilstaande wolk
            dustClouds.push(new DustCloud()); // Nog een bewegende wolk

            // Start de animatieloop
            animate();
        }

        // De hoofdanimatieloop
        function animate() {
            // Wis het canvas
            ctx.clearRect(0, 0, canvas.width, canvas.height);

            // Update en teken elke wolk in de array
            dustClouds.forEach(cloud => {
                cloud.update();
                cloud.draw();
            });

            // Update en teken elke ster
            stars.forEach(star => {
                star.update();
                star.draw();
            });

            // Vraag de browser om de volgende animatiefase
            requestAnimationFrame(animate);
        }

        // Roep init aan wanneer het venster geladen is
        window.onload = init;
        // Pas het canvas aan als het venster van grootte verandert
        window.onresize = init;
    </script>
